import React from "react";

const HomeNavbar = () => {
  const mystyle = {
    backgroundImage: "url('backgroundimg.jpg')",

    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  return (
    <div style={mystyle}>
      <h1>Home Page</h1>
      <p>Welcome to the Home page!</p>
    </div>
  );
};

export default HomeNavbar;
